                        </div>
                    </div>
                    <div className={s.card}>
                        <img src={imageFestival}></img>
                        <div>
                            <h3>Three wonderfully bizarre Mexican festivals</h3>
                            <p>It is not all skulls and tequila shots when it comes to festivals in Mexico, not when you have donkeys, radishes and candles compete to add fun</p>
                        </div>
                    </div>

                </div>
            </div>
        </div>
    );
}

